import { createSlice } from "@reduxjs/toolkit";

export const dataSlice = createSlice({
    name: "student Data",
    initialState: {
        heading: "Students",
        data: []
    },
    reducers: {
        AddingData: () => {
            console.log("aaaaa");
        }
    }
})
export const {AddingData } = dataSlice.actions
